import App from './App';

function HomePage(){

}
var cardListHolder = App.getCardListArray();

for(let i = 0; i < cardListHolder; i++){
    const deck = document.createElement("div");
    deck.className = 'deck';

    const name = document.createElement("h2");
    name.innerHTML = 'namePlaceholder';

    const studyDeck = document.createElement("button");
    studyDeck.HTML = 'STUDY';
    const editDeck = document.createElement("button");
    editDeck.HTML = 'EDIT';
    const deleteDeck = document.createElement("button");
    deleteDeck.HTML = 'DELETE';

    deck.appendChild(name);
    deck.appendChild(studyDeck);
    deck.appendChild(editDeck);
    deck.appendChild(deleteDeck);

    document.body.appendChild(deck);
}

export default HomePage;
